import React from "react";
import Button from "@mui/material/Button";
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import backgroundImage from "../assets/BackgroundImage.png";
import logo from "../assets/logo.png";
import campechana from "../assets/campechana.png";

import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const array = ["hola", "hola2", "hola3"];

function Home() {
  return (
    <Box
    sx={{
      position: "relative",
      minHeight: "100vh",
      backgroundImage: `url(${backgroundImage})`,
      backgroundSize: "cover",
      flexDirection: "column",
      justifyContent: "center",
      alignItems: "center",
      '&::before': {
        content: '""',
        position: "absolute",
        top: 0,
        left: 0,
        width: "100%",
        height: "100%",
        backgroundColor: "rgba(0, 0, 0, 0.5)", // Adjust opacity here
        zIndex: 0,
      },
    }}
  >
    <>
        {array.map((element, index) => {
          return <Button key={index} variant="text">{element}</Button>;
        })}

        <div>


       
        <Grid container spacing={2}>
          <Grid item lg={5} md={4} xs={3}></Grid>
          <Grid item lg={2} md={4} xs={6}>
            <Card sx={{ borderRadius: "2rem", backgroundColor: "black", display: "flex", justifyContent: "center", alignItems: "center" }} elevation={5}>
              <img src={logo} alt="Logo" style={{ width: "80%", height: "auto", padding: "1rem" }} />
            </Card>
          </Grid>
          <Grid item lg={5} md={4} xs={3}></Grid>
        </Grid>




        <h1 className="font-bold" style={{ color: 'white' }}>Promociones</h1>

        <Card sx={{ borderRadius: "1rem", backgroundColor: "black", position: "relative", maxWidth: "24rem", display: "flex" }} elevation={5}>
          <div style={{ width: "50%", position: "relative", overflow: "hidden", display: "flex", flexDirection: "column" }}>
            <div style={{ flex: 1, backgroundColor: "red", display: "flex", justifyContent: "center", alignItems: "center" }}>
              <Grid container justifyContent="center" alignItems="center" spacing={1}>
                <Grid item xs={12}>
                <h1 className="font-bold" style={{ color: 'white' }}>3 x 2</h1>
                </Grid>
                <Grid item xs={12}>
                <h2 className="font-bold" style={{ color: 'black' }}>Campechanas</h2>
                </Grid>
                <Grid item xs={12}>
                <h3 className="font-medium" style={{ color: 'black' }}> De $297 a</h3>
                </Grid>
                <Grid item xs={12}>
                <h1 className="font-bold" style={{ color: 'black' }}> $198</h1>

                 
                </Grid>
              </Grid>
            </div>
          </div>
          <div style={{ width: "50%", height: "100%" }}>
            <img src={campechana} alt="Campechana" style={{ width: "100%", height: "100%", objectFit: "cover" }} />
          </div>
        </Card>


        <div style={{ width: "90%", margin: "0 auto", marginTop: "100px" }}>
          <Slider
            dots={true}
            infinite={true}
            speed={800}
            autoplay={true}
            autoplaySpeed={2000}
            slidesToShow={4}
            slidesToScroll={4}
            responsive={[
              {
                breakpoint: 1024,
                settings: {
                  slidesToShow: 3,
                  slidesToScroll: 3,
                  infinite: true,
                  dots: true
                }
              },
              {
                breakpoint: 600,
                settings: {
                  slidesToShow: 2,
                  slidesToScroll: 2
                }
              },
              {
                breakpoint: 480,
                settings: {
                  slidesToShow: 1,
                  slidesToScroll: 1
                }
              }
            ]}
          >
            <div><img src="https://res.cloudinary.com/dxfq3iotg/image/upload/v1565190720/gallery/preview/02_o_car.jpg" alt="Car 1" /></div>
            <div><img src="https://res.cloudinary.com/dxfq3iotg/image/upload/v1565190715/gallery/preview/03_r_car.jpg" alt="Car 2" /></div>
            <div><img src="https://res.cloudinary.com/dxfq3iotg/image/upload/v1565190714/gallery/preview/04_g_car.jpg" alt="Car 3" /></div>
            <div><img src="https://res.cloudinary.com/dxfq3iotg/image/upload/v1565190714/gallery/preview/01_b_car.jpg" alt="Car 4" /></div>
            <div><img src="https://res.cloudinary.com/dxfq3iotg/image/upload/v1565190720/gallery/preview/02_o_car.jpg" alt="Car 5" /></div>
            <div><img src="https://res.cloudinary.com/dxfq3iotg/image/upload/v1565190715/gallery/preview/03_r_car.jpg" alt="Car 6" /></div>
            <div><img src="https://res.cloudinary.com/dxfq3iotg/image/upload/v1565190714/gallery/preview/04_g_car.jpg" alt="Car 7" /></div>
            <div><img src="https://res.cloudinary.com/dxfq3iotg/image/upload/v1565190714/gallery/preview/01_b_car.jpg" alt="Car 8" /></div>
          </Slider>
        </div>

        </div>
      </>
    </Box>
  );
}

export default Home;
